import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";
import {Routes,Route } from 'react-router-dom';
import Home from "./components/Home";
import About from "./components/About";
import Update from "./components/Update";
import Testimonial from "./components/Testimonial";
import Gallery from "./components/Gallery";
import Contact from "./components/Contact";
import NavbarComponent from "./components/Navbar";
import Footer from "./components/Footer"


const App=()=>{
return(
  <>
  <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3765.914519042499!2d72.86702181482529!3d19.28608318696773!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3be7b10d5fe85af7%3A0xad096ac9aba6c0b8!2sSai%20Samarth%20ENT(Ear%2C%20Nose%2C%20Throat)%20Clinic%20Dr%20Rahul%20Patil!5e0!3m2!1sen!2sin!4v1655363191147!5m2!1sen!2sin" ></iframe>
<NavbarComponent/>
<Routes >
    <Route   path="/" element={<Home />} /> 
    <Route   path="/about"  element={<About/>} />
    <Route   path="/update"  element={<Update />} />
    <Route   path="/testmonial"  element={<Testimonial/>}/> 
    <Route   path="/gallery"  element={<Gallery/>}/> 
    <Route   path="/contact"  element={<Contact/>} />

  </Routes>

<Footer/>

  </>
);
}

export default App;
